import React from 'react';
import { BookOpen, Facebook, Twitter, Instagram, Mail } from 'lucide-react';
import { Link } from 'react-router-dom';

const Footer = () => {
  const aboutLinks = [
    { name: 'Contact Us', path: '/contact' },
    { name: 'About Us', path: '/about' },   
    { name: 'All Courses', path: '/all-courses' },
    { name: 'Teach on LearnIT', path: '/teach' },
  ];

  const socialMediaLinks = [
    { name: 'Facebook', icon: Facebook, url: 'https://www.facebook.com/yourplatform' },
    { name: 'Twitter', icon: Twitter, url: 'https://twitter.com/yourplatform' },
    { name: 'Instagram', icon: Instagram, url: 'https://instagram.com/yourplatform' },
  ];

  return (
    <footer className="bg-gradient-to-r from-gray-900 via-purple-900 to-gray-900 text-gray-300 border-t border-purple-800/30 mt-12">
      <div className="container mx-auto px-4 py-12">
        <div className="flex flex-col md:flex-row md:justify-between md:items-start gap-12 mb-10">
          {/* Brand & Newsletter */}
          <div className="flex-1 min-w-[220px] mb-8 md:mb-0">
            <div className="flex items-center mb-4">
              <BookOpen className="h-9 w-9 text-purple-500" />
              <span className="ml-3 text-2xl font-bold text-white tracking-tight">LearnIT</span>
            </div>
            <p className="text-gray-400 mb-6 max-w-xs">Empowering learners and educators with modern, accessible, and engaging online education.</p>
            <form className="flex items-center max-w-xs">
              <input
                type="email"
                placeholder="Your email for updates"
                className="flex-1 px-4 py-2 rounded-l-full bg-white/10 border border-white/20 text-gray-200 placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-purple-400"
              />
              <button
                type="submit"
                className="bg-purple-600 hover:bg-purple-700 text-white px-4 py-2 rounded-r-full font-semibold transition-colors duration-200 flex items-center"
              >
                <Mail className="h-5 w-5 mr-1" />Subscribe
              </button>
            </form>
          </div>

          {/* About Links */}
          <div className="flex-1 min-w-[180px] mb-8 md:mb-0">
            <h5 className="font-semibold text-white mb-4 tracking-wide text-lg">About</h5>
            <ul className="space-y-3">
              {aboutLinks.map((link, index) => (
                <li key={index}>
                  <Link
                    to={link.path}
                    className="text-base hover:text-purple-400 hover:underline transition-colors duration-200"
                  >{link.name}</Link>
                </li>
              ))}
            </ul>
          </div>

          {/* Social Media */}
          <div className="flex-1 min-w-[180px]">
            <h5 className="font-semibold text-white mb-4 tracking-wide text-lg">Follow Us</h5>
            <div className="flex space-x-5 mb-4">
              {socialMediaLinks.map((social, index) => {
                const IconComponent = social.icon;
                return (
                  <a
                    key={index}
                    href={social.url}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-gray-400 hover:text-purple-400 transition-transform duration-200 hover:scale-110"
                  >
                    <IconComponent className="h-7 w-7" />
                  </a>
                );
              })}
            </div>
            <p className="text-gray-500 text-sm">Stay connected for updates and news.</p>
          </div>
        </div>
        <div className="flex flex-col md:flex-row justify-between items-center border-t border-purple-800/30 pt-6">
          <p className="text-sm text-gray-500 mb-3 md:mb-0">&copy; {new Date().getFullYear()} LearnIT, Inc. All rights reserved.</p>
          <div className="flex items-center space-x-2 text-xs text-gray-500">
            <span>Made with</span>
            <span className="text-purple-400">&#10084;</span>
            <span>by the LearnIT Team</span>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
